Database selection for soft matching queries<p>Hi I am trying to choose a database (preferrably mongodb) that can execute the following query:</p>

<p>Say there is are objects in the database with an array of items:</p>

<pre><code>Obj {
    items: [a, b, c, d, e, f]
},
Obj {
    items: [d, e, f, g, h, i]
},
Obj {
    items: [a, z]
},
Obj {
    items: [x, y, z]
}
</code></pre>

<p>And I want to do a soft search for the objects with the most matching items to a search array, eg. </p>

<pre><code>searchArray = [a, b, c, g, i]
</code></pre>

<p>would ideally return me the first three elements in decreasing order (As there are 3 matched array items in the first element, 2 in the second, and 1 in the third), as you can imagine as the collection grows large it will be important to only return the maximum matched elements.</p>

<p>Is there any way to implement this kind of query in mongodb or any relational databases?</p>

