C# MongoDB Driver: Can't find the way to run complex query for AnyIn filter in MongoDB<p>I have a document like this:</p>

<pre><code>{
  "id": "xxxxxxxxxxxx",
  "groupsAuthorized": [
    "USA/California/SF",
    "France/IDF/Paris"
  ]
}
</code></pre>

<p>And I have an user that has a list of authorized groups, like for example the following:</p>

<pre><code>"groups": [
  "France/IDF",
  "USA/NY/NYC"
]
</code></pre>

<p>What I'm trying to achieve is to retrieve all documents in the database that the user is authorized to retrieve, essentially I want to be able to check in the list "groupsAuthorized" if one of the group contains a subset of an element of the other list "groups" contained in my user authorizations</p>

<p>using the following values:</p>

<pre><code>my document:
{
  "id": "xxxxxxxxxxxx",
  "groupsAuthorized": [
    "USA/California/SF",
    "France/IDF/Paris"
  ]
}

my user permissions:
"groups": [
  "France/IDF",
  "USA/NY/NYC"
]
</code></pre>

<p>the user should be able to retrieve this document as the string "France/IDF" is correctly contained in the string "France/IDF/Paris", however, if the values would've been like this:</p>

<pre><code>my document:
{
  "id": "xxxxxxxxxxxx",
  "groupsAuthorized": [
    "USA/California/SF",
    "France/IDF"
  ]
}

my user permissions:
"groups": [
  "France/IDF/Paris",
  "USA/NY/NYC"
]
</code></pre>

<p>it should not work, because my user is only authorized to view documents from France/IDF/Paris and USA/NY/NYC and none of the string inside of the authorizedGroups of my document contains those sequences</p>

<p>I've tried to use a standard LINQ query to achieve this which is fairly simple:</p>

<pre><code>var userAuthorizedGroups = new List&lt;string&gt; { "France/IDF/Paris", "USA/NY/NYC" };
var results = collection.AsQueryable()
.Where(entity =&gt; userAuthorizedGroups
                .Any(userGroup =&gt; entity.authorizedGroups
                                  .Any(entityAuthorizedGroup =&gt; entityAuthorizedGroup.Contains(userGroup))));
</code></pre>

<p>But i'm getting the famous unsupported filter exception that it seems lot of people is having, i've tried different options found on the internet like the following:</p>

<pre><code>var userAuthorizedGroups = new List&lt;string&gt; { "France/IDF/Paris", "USA/NY/NYC" };
var filter = Builders&lt;PartitionedEntity&lt;Passport&gt;&gt;.Filter.AnyIn(i =&gt; i.authorizedGroups, userAuthorizedGroups);
var results = (await collection.FindAsync(filter)).ToList();

return results;
</code></pre>

<p>But the problem is this will only check if one of the element of the array is contained inside the other array, It will not correctly work for case like "France/IDF" that should correctly match "France/IDF/Paris" because "France/IDF" string is contained inside the "France/IDF/Paris" string inside of my document</p>

<p>I'm getting a bit clueless on how to achieve this using the mongodb C# driver, i'm starting to think that I should just pull all documents to client and do the filtering manually but that would be quite messy</p>

<p>Has anyone an Idea on this subject ?</p>

