<pre><code>{
    A_id: a1,
    A_list:
    {[
      {B_id: b1, B_boolean: true},
      {B_id: b2, B_boolean: false},
      {B_id: b3, B_boolean: true},
      ...
    ]}
},
{
    A_id: a2,
    A_list:
    {[
      {B_id: b1, B_boolean: true},
      {B_id: b4, B_boolean: true},
      ...
    ]}
},
...
</code></pre>

<p>Basically, there's a mapping from <code>A_id</code> to <code>B_id</code>
Now I want to create a collection <code>B</code> out of the data in <code>A</code> showing a reversed mapping from <code>B_id</code> to <code>A_id</code>(I only care about the relation between <code>B_id</code> and <code>A_id</code>). I expect <code>B</code> to be like:</p>

<pre><code>{
    B_id: b1,
    B_list:
    {[A_id: a1, A_id: a2]}

},
{
    B_id: b2,
    B_list:
    {[A_id: a1]}

},
{
    B_id: b3,
    B_list:
    {[A_id: a1]}

},
...
</code></pre>

<p>I'm quite new to MongoDB. Could anyone please let me know how to write this query? Thanks in advance!</p>

